  ITHOMSON, Christine Margaret and PYNER, Jeremy Dorian
  03> THOMSON, Christine Margaret m on 25.06.1975 to PYNER, Jeremy Dorian
  b 29.08.1947
  b 02.06.1949
  Christine b, at Hastings and m. at Napier. Jeremy, slo Geoffrey Pyner and Marjorie Francis Nelson.
  Christine played the piano at school. She did an Arts Degree and Fine Arts study and became an art
  teacher, then married and went to Australia. She painted heraldic crests, had babies and reared orphan
  kangaroos. She decided to become a vet and graduated (Queensland) in 1982 at age 35 then set up her
  own practice in a country town. She recently learnt to fly and now takes family trips to see
  Australia.
  01> PYNER, Morgan Charles
  b 17.02.1977
  02> PYNER, Acacia Marjorie
  b 14.01.1979
  04> THOMSON, Anne Mary (Min) m on 14.04.1973 to (1) REEVES, Ian James Stewart
  b 06.09.1948
  b 12.12.1945
  Min b. at Hastings and m. at Havelock North. Divorced 1987. Ian, s/o Stanley Reeves and Blanche
  Stewart.
  Min attended Marsden College, Wellington and trained as a registered nurse at Middlemore Hospital and
  worked as a practice nurse. She travelled to England where she met Ian. Following her marriage she
  became a professional exporter of orchids. Min is a proficient keen horse rider.
  01> REEVES, Angus James Stanley
  b 02.08.1975
  Angus is a drama student at Northland Polytechnic and his interests include lighting, sound and
  motorbikes.
  02> REEVES, Nicholas Charles
  b 27.08.1976
  Nicholas is a drama student at Northland Polytechnic and his interests are drama generally and
  motorbikes.
  04> THOMSON, Anne Mary (Min) and (2)LEE, Mike
  b 06.09.1948
  b 18.04.1951
  Mike b. at Manakau Peninsula. Address: Stuart Road, Mcleod Bay, RD 4, Whangarei.
  Min was coordinator of Youth Help, an organisation which assists young people and their families. Mike
  worked in a similar organisation and they live at McLeod Bay with four teenagers from their combined
  families plus assorted animals. They recently went to Japan and brought back a 27m squid/longlines
  fishing boat which they operated out of Nelson and Rarotonga for 18 months,
  06> NELSON, Michael m on 19.07.1955 to ADAMS, Jean Emily
  b 14.10.1928
  b 13.04.1932
  Michael b, at Wellington and m. in Sussex, England. Jean, d/o Ernest Adams and Jean West. Address: Carlos
  Ossandon 1682-D, La Reina, Santiago, Chile.
  Michael is a resource economist working on natural resource issues throughout Latin America. Jean was an
  Olympic skiier in her youth. She taught history and geography for many years. Both Michael and Jean have
  continued skiing and mountaineering and have recently taken up sailing.
